import * as React from 'react';
import { Text, View, StyleSheet,SafeAreaView,StatusBar,ScrollView,TouchableOpacity } from 'react-native';
import Constants from 'expo-constants';
import {
  useFonts as useOswald,
  Oswald_400Regular,
} from "@expo-google-fonts/oswald";
import { useFonts as useLato, Lato_400Regular } from "@expo-google-fonts/lato";
import { Card } from 'react-native-paper';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { StatusBar as ExpoStatusBar } from "expo-status-bar";
import {SignupUser} from './components/screens/SignupUser';
import {SignupUser1} from './components/screens/SignupUser1';
import {SignupUser2} from './components/screens/SignupUser2';
import {SignupUser3} from './components/screens/SignupUser3';
import {SignupUser4} from './components/screens/SignupUser4';
import {Login} from './components/screens/login';
import {Home} from './components/screens/home';
//import {UserNavigator} from './components/navigators/UserNavigator';
//import {ServiceProviderNavigator} from './components/navigators/ServiceProviderNavigator';
import {TypeSignup} from './components/screens/typeSignup';
const Stack = createStackNavigator();
export default function App() {

  return (
    <>
        <NavigationContainer>
       <Stack.Navigator >
      <Stack.Screen name="Login" component={Login}/>
      <Stack.Screen name="Home" component={Home}/>
       <Stack.Screen name="Typesignup" component={TypeSignup}/>
        <Stack.Screen name="Signup" component={SignupUser}/>
        <Stack.Screen name="Signup1" component={SignupUser1}/>
         <Stack.Screen name="Signup2" component={SignupUser2}/> 
         <Stack.Screen name="Signup3" component={SignupUser3}/>   
          <Stack.Screen name="Signup4" component={SignupUser4}/>

        </Stack.Navigator>
        </NavigationContainer>
 </>  
  );
}
